    public static boolean isValid (String s) {
        // write code here
        if(s.contains("(}")){
            return false;
        }
        if(s.contains("(]")){
            return false;
        }
        if(s.contains("[}")){
            return false;
        }
        if(s.contains("[)")){
            return false;
        }
        if(s.contains("{)")){
            return false;
        }
        if(s.contains("{]")){
            return false;
        }
        // 获取空字符串的数量
        Stack<Character> stack = new Stack<>();
        for (Character c: s.toCharArray()) {
            if(c == '('){ stack.push(')'); continue;}
            if(c == '{'){ stack.push('}'); continue;}
            if(c == '['){ stack.push(']'); continue;}
            if(stack.isEmpty() || stack.pop().equals(c)){
                return false;
            }
        }
        return stack.isEmpty();
    }
    public static String resolve(String s){
        // 通过有序的方式遍历 入栈出栈的方式
        // 从第一个反括号开始替换
        // 第一个复合字符串
        StringBuilder sb  = new StringBuilder(s);
        while (sb.indexOf("|") > 0){
            int end = sb.indexOf("]");
            String s1 = sb.substring(0,end); // HG[3|B[2|CA
            int begin = s1.lastIndexOf("[");
            String s2 = s1.substring(begin+1); // 2|CA
            String[] value = s2.split("\\|");
            String  s3 = caculate(Integer.parseInt(value[0]),value[1]);
            System.out.println("start="+begin + ",end=" + end);
            sb.replace(begin,end+1,s3);
            System.out.println(sb);
        }
        System.out.println(sb);
        return sb.toString();
    }
    public static String caculate(int num,String s){
        StringBuilder sb = new StringBuilder("");
        for(int i = 0;i<num;i++){
            sb.append(s);
        }
        return sb.toString();
    }
